import React, { Component } from 'react';

class Footer extends Component {
    render(){
        const styles = {
            display: 'flex-box',
            flexDirection: 'flex-row'
        }
        return(
            <div>
                <h5>Want to build your own MYtenerary?</h5>
                <div style={styles}>
                    <div><a href="">Log in</a></div>
                    <div><a href="">Create Account</a></div>
                </div>
            </div>
        )
    }
}

export default Footer;
